   "pages.login.partner.work.with.vshoo.text": "\u0412 \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u043D\u0438\u0438 \u0441\u0438\u0441\u0442\u0435\u043C\u044B \u0443\u043F\u0440\u0430\u0432\u043B\u0435\u043D\u0438\u044F VShoo \u0422\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442 \u0434\u043B\u044F \u0412\u0430\u0448\u0435\u0439 \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u043D\u043E\u0439 \u043A\u043E\u043C\u043F\u0430\u043D\u0438\u0438 \u0435\u0441\u0442\u044C \u0431\u043E\u043B\u044C\u0448\u0438\u0435 \u043F\u0440\u0435\u0438\u043C\u0443\u0449\u0435\u0441\u0442\u0432\u0430. \u041A\u0430\u043A \u0447\u0438\u0441\u0442\u0438\u0446\u0430 VShoo \u0441\u0435\u043C\u044C\u0438, \u0412\u044B \u043D\u0435 \u0442\u043E\u043B\u044C\u043A\u043E \u0431\u0443\u0434\u0435\u0442\u0435 \u0432\u044B\u0433\u043E\u0434\u043D\u0430 \u043F\u043E\u043B\u0443\u0447\u0430\u0442\u044C \u0437\u0432\u043E\u043D\u043A\u0438 \u043A\u043B\u0438\u0435\u043D\u0442\u043E\u0432, \u043D\u043E \u0442\u0430\u043A\u0436\u0435 \u0441\u043C\u043E\u0436\u0435\u0442\u0435 \u043B\u0435\u0433\u043A\u043E \u0443\u043F\u0440\u0430\u0432\u043B\u044F\u0442\u044C \u0441\u0432\u043E\u0438\u043C \u0431\u0438\u0437\u043D\u0435\u0441\u043E\u043C \u043A\u0430\u0436\u0434\u0443\u044E \u0441\u0435\u043A\u0443\u043D\u0434\u0443 \u043F\u043E\u043B\u0443\u0447\u0430\u044F \u043E\u0442\u0447\u0435\u0442\u044B \u043E \u0435\u0437\u0434\u0435 \u0438 \u0432\u044B\u0440\u0443\u0447\u043A\u0435.",  // Used in: 
