   "pages.login.driver.independent.driver.text": "\u0421\u043D\u0430\u0447\u0430\u043B\u0430 \u0412\u044B \u0434\u043E\u043B\u0436\u043D\u044B \u0441\u043E\u0437\u0434\u0430\u0442\u044C \u0441\u0432\u043E\u044E \u0441\u043E\u0431\u0441\u0442\u0432\u0435\u043D\u043D\u0443\u044E \u043A\u043E\u043C\u043F\u0430\u043D\u0438\u044E, \u0435\u0433\u043E \u0440\u0430\u0441\u043F\u043E\u043B\u043E\u0436\u0435\u043D\u0438\u0435, \u0437\u0430\u0442\u0435\u043C \u0430\u043A\u043A\u0430\u0443\u043D\u0442 \u0432\u043E\u0434\u0438\u0442\u0435\u043B\u044F. \u0412 \u043D\u0430\u043B\u0438\u0447\u0438\u0438 \u0442\u0440\u0451\u0445 \u0430\u043A\u043A\u0430\u0443\u043D\u0442\u043E\u0432 \u0412\u044B \u0441\u043C\u043E\u0436\u0435\u0442\u0435 \u043B\u0435\u0433\u043A\u043E \u0443\u043F\u0440\u0430\u0432\u043B\u044F\u0442\u044C \u0441\u0432\u043E\u0438\u043C \u0431\u0438\u0437\u043D\u0435\u0441\u043E\u043C. \u041F\u043E\u0436\u0430\u043B\u0443\u0439\u0441\u0442\u0430, \u043E\u0431\u0440\u0430\u0442\u0438\u0442\u0435\u0441\u044C \u043A <ahref=\"partner-area.htm\" class=\"partner_area_link\"> \u0421\u0444\u0435\u0440\u0430 \u043F\u0430\u0440\u0442\u043D\u0435\u0440\u0430 </a> \u0447\u0442\u043E\u0431\u044B \u043F\u043E\u0434\u0440\u043E\u0431\u043D\u043E \u043E\u0437\u043D\u0430\u043A\u043E\u043C\u0438\u0442\u044C\u0441\u044F \u0441 \u0438\u043D\u0441\u0442\u0440\u0443\u043A\u0446\u0438\u0435\u0439: \u043A\u0430\u043A \u0441\u043E\u0437\u0434\u0430\u0442\u044C \u0412\u0430\u0448\u0443 \u043A\u043E\u043C\u043F\u0430\u043D\u0438\u044E, \u0435\u0433\u043E \u0440\u0430\u0441\u043F\u043E\u043B\u043E\u0436\u0435\u043D\u0438\u0435 \u0438, \u043D\u0430\u043A\u043E\u043D\u0435\u0446, \u0430\u0432\u0442\u043E\u0440\u0438\u0437\u043E\u0432\u0430\u0442\u044C \u0441\u0432\u043E\u0439 \u0430\u043A\u043A\u0430\u0443\u043D\u0442.",  // Used in: 
   "pages.login.driver.if.you.dont.driver.text": "\u0412\u044B \u043C\u043E\u0436\u0435\u0442\u0435 \u0437\u0430\u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0438\u0440\u043E\u0432\u0430\u0442\u044C\u0441\u044F, \u0432\u044B\u0431\u0440\u0430\u0432 \u043A\u043E\u043C\u043F\u0430\u043D\u0438\u044E \u0433\u0434\u0435 \u0412\u044B \u0440\u0430\u0431\u043E\u0442\u0430\u0435\u0442\u0435, \u0435\u0433\u043E \u0442\u043E\u0447\u043D\u043E\u0435 \u0440\u0430\u0441\u043F\u043E\u043B\u043E\u0436\u0435\u043D\u0438\u0435 \u0438 \u0441\u043E\u0437\u0434\u0430\u0442\u044C \u0430\u043A\u043A\u0430\u0443\u043D\u0442. \u0410\u0434\u043C\u0438\u043D\u0438\u0441\u0442\u0440\u0430\u0446\u0438\u044F \u043A\u043E\u043C\u043F\u0430\u043D\u0438\u0438 \u0434\u043E\u043B\u0436\u0435\u043D \u043E\u0434\u043E\u0431\u0440\u0438\u0442\u044C \u0412\u0430\u0448 \u0430\u043A\u043A\u0430\u0443\u043D\u0442 \u0438 \u0430\u043A\u0442\u0438\u0432\u0438\u0440\u043E\u0432\u0430\u0442\u044C \u0435\u0433\u043E, \u0447\u0442\u043E\u0431\u044B \u0412\u044B \u0438\u043C\u0435\u043B\u0438 \u0432\u043E\u0437\u043C\u043E\u0436\u043D\u043E\u0441\u0442\u044C \u0432\u043E\u0439\u0442\u0438 \u0432 \u0441\u0432\u043E\u0439 \u0430\u043A\u043A\u0430\u0443\u043D\u0442.",  // Used in: 
